import React from 'react';
import ReactDOM from 'react-dom';

const fullName = "Nawaraj Luitel";
let current_datetime = new Date().toLocaleDateString();

ReactDOM.render(
  <>
    <h1>{`My name is ${fullName}`}</h1>
    <p>The current date is {current_datetime}/{current_datetime.getMonth()}/{current_datetime.getFullYear()}</p>
    <p>The current time is {current_datetime.toTimeString()}</p>
  </>,

  document.getElementById('root')
);
